import React, { useState } from 'react'

function IntentContainer(props) {
    const [bg, setbg] = useState('transparent')
    const handelClick = () => {
        setbg('rgba(180, 180, 180, 0.5)', () => {
            props.showententForm()
        })
    }
    return (
        <div style={{ width: 457, border: "1px solid #B4B4B4", borderRadius: 15, padding: 20 }}>
            <h4 style={{ marginTop: 0 }}>Select Intents</h4>
            <div style={{ display: "flex", flexWrap: "wrap", background: bg }}>
                <button className="btn" onClick={handelClick}>Price</button>
            </div>
        </div>
    )
}

export default IntentContainer
